Entry.Value:
int gr=20;

        public override void Init() {
            base.Init();
        }



     public override long InSet(double ar, double ai, double aj, double br, double bi, double bj, double bk, long zkl, bool invers) {

          double xx, yy, zz;
          long tw;
          int n;
          double x = ar, y = ai, z = aj;

          xx = x * x; yy = y * y; zz = z * z;
          tw = 0;
          double r = Math.Sqrt(xx + yy + zz);
          Fractrace.Geometry.VecRotation vecRot = new Fractrace.Geometry.VecRotation();
          for (n = 1; n < zkl; n++) {

// 1. Rotation

            double phi = Math.Atan2(y, x);
       double phi2 = Math.Atan2(y, z);

double mult1=-4.0;
double mult2=-2.0;
double mult3=2.0;
double mult4=2.0;
double mult5=2.0;
double mult6=2.0;


            vecRot.y = -Math.Sin(mult2*phi2);
            vecRot.x =0;
            vecRot.z =-Math.Cos(mult2*phi2);
            vecRot.angle =mult1*phi;
            vecRot.Normalize();
            Fractrace.Geometry.Vec3 pos=new Fractrace.Geometry.Vec3(x,y,z);
            Fractrace.Geometry.Vec3 newPos= vecRot.getTransform(pos);
            x = newPos.X;
            y = newPos.Y;
            z = newPos.Z;
            xx = x * x; yy = y * y; zz = z * z;// aak = ak * ak;
         //   r = Math.Sqrt(xx + yy + zz);
r=xx+yy+zz;
            x *= r;
            y *= r;
            z *= r;

// 2. Rotation

            phi = Math.Atan2(y, x);
      phi2 = Math.Atan2(x, z);


            vecRot.x = -Math.Sin(mult3*phi2);
            vecRot.y =0;
            vecRot.z =-Math.Cos(mult3*phi2);
            vecRot.angle =mult4*phi;
            vecRot.Normalize();
            pos=new Fractrace.Geometry.Vec3(x,y,z);
             newPos= vecRot.getTransform(pos);
            x = newPos.X;
            y = newPos.Y;
            z = newPos.Z;
            xx = x * x; yy = y * y; zz = z * z;// aak = ak * ak;
     //       r = Math.Sqrt(xx + yy + zz);
r=xx+yy+zz;
r*=r;
r*=r;

            x *= r;
            y *= r;
            z *= r;

// 3. Rotation

            phi = Math.Atan2(z, x);
      phi2 = Math.Atan2(x, y);


            vecRot.x = -Math.Sin(mult5*phi2);
            vecRot.z =0;
            vecRot.y =-Math.Cos(mult5*phi2);
            vecRot.angle =mult6*phi;
            vecRot.Normalize();
            pos=new Fractrace.Geometry.Vec3(x,y,z);
             newPos= vecRot.getTransform(pos);
            x = newPos.X;
            y = newPos.Y;
            z = newPos.Z;
            xx = x * x; yy = y * y; zz = z * z;// aak = ak * ak;
     //       r = Math.Sqrt(xx + yy + zz);
r=xx+yy+zz;
r*=r;
r*=r;

            x *= r;
            y *= r;
            z *= r;

            y += bj;
            x += br;
            z += bi;

            if (r > gr) {
              tw = n; break;
            }
          }


// Hinzugefügt, um bei der Ansicht von innen nur den Kern zu zeigen. 
          if (invers) {
            if (tw == 0)
              tw = 1;
            else
              tw = 0;
          }
          return (tw);
        }
